      const POINTS = DATA.points;
      const TOPS = DATA.tops;
      console.log(TOPS);

      const scene = new THREE.Scene();
      scene.fog = new THREE.FogExp2(0x000000, 0.001);
      const camera = new THREE.PerspectiveCamera(75, window.innerWidth / window.innerHeight, 0.1, 1000);
      const renderer = new THREE.WebGLRenderer();
      renderer.setSize(window.innerWidth, window.innerHeight);
      document.addEventListener('DOMContentLoaded', function() {
        document.body.appendChild(renderer.domElement);
      });
      const controls = new OrbitControls(camera, renderer.domElement);
      camera.position.set(-10, -10, -10);
      camera.lookAt(new THREE.Vector3(0, 0, 0));
      function calculateCenter(frame) {
        const sum = frame.reduce((acc, val) => {
          acc[0] += val[0];
          acc[1] += val[1];
          acc[2] += val[2];
          return acc;
        }, [0, 0, 0]);
        return sum.map(s => s / frame.length);
      }
      const center = calculateCenter(POINTS[0]);
      console.log('center', center);
      controls.target.set(...center);
      controls.update();

      let currentFrameIndex = 0;
      let lastSwitchTime = performance.now();
      const frameDuration = 500; // Frame duration in milliseconds
      function distance(point1, point2) {
        const dx = point1[0] - point2[0];
        const dy = point1[1] - point2[1];
        const dz = point1[2] - point2[2];
        return Math.sqrt(dx * dx + dy * dy + dz * dz);
      }

      // Function to find the three nearest neighbors of each point
      function findNearestNeighbors(points) {
        return points.map((point, index) => {
          let maxDist = 0;
          const distances = points.map((otherPoint, otherIndex) => {
            const pd = distance(point, otherPoint);
            if (pd > maxDist) {
              maxDist = pd;
            }
            return {
              index: otherIndex,
              distance: pd,
            };
          }).filter(d => d.index !== index); // Exclude the point itself
          distances.sort((a, b) => a.distance - b.distance);
          return distances
            .slice(0, 6)
            .map(di => {
              const neighborPoint = points[di.index];
              const lineGeometry = new THREE.BufferGeometry().setFromPoints([
                new THREE.Vector3(...point),
                new THREE.Vector3(...neighborPoint)
              ]);
              const distrat = 1.0 - Math.min(di.distance / Math.sqrt(maxDist), 1);
              return new THREE.Line(lineGeometry, new THREE.LineBasicMaterial({ color: new THREE.Color(distrat, 0, 1 - distrat) }));
            });
        });
      }
      // Calculate nearest neighbors and add lines
      const neighbors = POINTS.map(findNearestNeighbors);
      let running = true;
      let step = 0;

      // Modify animate function to include logic for adding lines
      function animate() {
        requestAnimationFrame(animate);

        const now = performance.now();
        if (running && now - lastSwitchTime > frameDuration) {
          lastSwitchTime = now;

          // Remove the previous frame's points and lines
          while(scene.children.length > 0){
            scene.remove(scene.children[0]);
          }

          // Add the new frame's points
          const frame = POINTS[currentFrameIndex];
          const geometry = new THREE.BufferGeometry();
          const positions = new Float32Array(frame.flat());
          geometry.setAttribute('position', new THREE.BufferAttribute(positions, 3));
          const material = new THREE.PointsMaterial({
            color: 0xCCCCCC,
            size: 0.5,
            sizeAttenuation: true,
            transparent: true,
            opacity: 0.8
          });
          const points = new THREE.Points(geometry, material);
          scene.add(points);
          for (const neighbor of neighbors[currentFrameIndex]) {
            for (const line of neighbor) {
              scene.add(line);
            }
          }
          document.getElementById('frame-info').textContent = `frame ${currentFrameIndex}`;
          document.getElementById('tops-info').textContent = TOPS[currentFrameIndex].map(top => {
            return `'${top[0]}' = ${top[1].toFixed(3)}\n`;
          });

          currentFrameIndex = (currentFrameIndex + 1) % POINTS.length;
          if (step > 0) {
            step = step - 1;
            if (step <= 0) {
              running = false;
            }
          } else if (currentFrameIndex === 0) {
            running = false;
            setTimeout(() => { running = true; }, 2000);
          }
        }
        controls.target.set(...center);
        controls.update();
        renderer.render(scene, camera);
      }

      document.addEventListener('keydown', function (e) {
        if (e.key === ' ') {
          running = !running;
        }
        if (e.key === '[') {
          currentFrameIndex = currentFrameIndex - 2;
          if (currentFrameIndex < 0) {
            currentFrameIndex = POINTS.length + currentFrameIndex;
          }
          step = 1;
          running = true;
        }
        if (e.key === ']') {
          step = 1;
          running = true;
        }
      });

      animate();
    </script>
